column5:
Update device.js

Add `device-windows` for customize scrollbar on windows, such as 

```
.device-windows {
     ::-webkit-scrollbar {
      width: 10px;
      height: 10px;
      background-color: #F4F7F8;
    }
     ::-webkit-scrollbar-thumb {
      border-radius: 0;
      background-color: #D3E4E7;
    }
}
```

Adds an OnLazyLoad Callback

It is sometimes really useful to detect when an image has been loaded
via lazy load.

This adds this functionality.

```
var myApp = new Framework7({
onLazyLoad: function (el) {

console.log(el.attr('data-src'));

}
});
```

Enable left and right swipePanel

With this "myApp.params.swipePanel" can be set to "left", "right" or "both"
It is working great and to avoid any conflict and overlapping add the below CSS and custom JS:

//CSS
.panel.active{
    display:block;
}
.with-panel-left-reveal .panel-right, .with-panel-right-reveal .panel-left{
    display:none !important;
}

//JS
$$('.panel-left').on('opened', function () {
    $$('.panel-right').hide();
    $$('.panel-left').show();
});
$$('.panel-right').on('opened', function () {
    $$('.panel-left').hide();
    $$('.panel-right').show();
});

Improvements

‚Äî removed unused variables;
‚Äî added var paramsPrefix, it has improved two places at code;
‚Äî iterate through objects using $.each

Fixes #429

Update lists.less

in ``position: absolute`` mode, 

```css
.sortable-handler {
    height: ~"-webkit-calc(100% - 1px)";
    height: ~"calc(100% - 1px)";
}
```

is semantically equivalent to

```css
.sortable-handler {
    top: 0;
    bottom: 1px;
}
```

and can produce better compatibility

Added option to ajax to include additional  xhrFields, e.g. add withCredentials = true;

Example usage:
```
var        options = {
                                url: 'someurl.php',
                                method: 'POST',
                                cache: true,
                                data: someObject,
                                xhrFields: {
                                    withCredentials: true
                                },
                                crossDomain: true
                            };

                        return $$.ajax(options);
```
